import React from "react";
import { NavLink } from "react-router-dom";

export default function NavBar() {
  return (
    <div style={{padding: "100",backgroundColor: "red", }}>
      <img
        src="logo192.png"
        alt="goldenShoe"
        style={{
          display: "block",
          maxWidth: "100%",

        }}
      />

      <NavLink activeStyle={{ fontWeight: "bold" }} 
      style={{
        color:"white" ,
        display: "block",
        textAlign: "center",
        padding: "14px 16px",
        textDecoration: "none"}} 
            to="/" exact>Home</NavLink>
      <NavLink activeStyle={{ fontWeight: "bold" }} 
      style={{
        color:"white" ,
        display: "block",
        textAlign: "center",
        padding: "14px 16px",
        textDecoration: "none"}} 
      to="/contact">Contact</NavLink>
      <NavLink activeStyle={{ fontWeight: "bold" }} 
      style={{
        color:"white" ,
        display: "block",
        textAlign: "center",
        padding: "14px 16px",
        textDecoration: "none"}} 
      to="/cart">Shopping Cart</NavLink>


    </div>
  );
}
